import React,{ Component } from 'react'
import {Link} from 'react-router-dom';
import image3 from '../images/image3.jpeg'
import image4 from '../images/image4.jpg'
import image5 from '../images/image5.jpg'
class Meditationex extends Component {
  render() {
      return (
       <div style={ImgDiv}>       <div className= 'float center text-center pb-5 text-color'>
        <h3 style={{color:"white"}} ><u>WHAT IS IN YOUR MIND</u></h3>
        </div>
       <div className= 'row pt-5'>
         
       <div className=' col text-center pt-5 border   '  style={{  marginLeft:"40px" ,marginRight:"40px",height:"350px" ,borderStyle:"solid",borderRadius:"20px", boxShadow: "0 10px 12px 0 rgba(0, 0, 0, 0.25)"}}>
       <div style={ImgDiv1}>
         <button class="btn btn-success" style={{}}>Meditation</button>
       </div>
       </div>
       <div className='col text-center  pb-5'  style={{ marginLeft:"px" ,marginRight:"15px",height:"350px" }}>
        <div style={ImgDiv2} >
         <button className="btn btn-success"style={{marginTop:"75px"}} >Exercise</button>
       </div>
       </div>
       </div>

       
        
        
        </div>



      )
  }  
}
const ImgDiv={
  backgroundImage: 'url('+image3+')',
  backgroundSize: "cover",
  backgroundAttachment: "fixed",
  height:"600px",
}


const ImgDiv1={
  backgroundImage: 'url('+image4+')',
  backgroundSize: "cover",
  backgroundAttachment: "fixed",
  height:"300px",
}

const ImgDiv2={
  backgroundImage: 'url('+image5+')',
  backgroundSize: "cover",
  backgroundAttachment: "fixed",
  height:"200px",
}
export default Meditationex;
